import React from "react";

const Teste = () => {
  const array1 = [
    {
      id: "4",
      idAntigo: "2",
      desc: "arroz",
    },
    {
      id: "3",
      idAntigo: "0",
      desc: "massa",
    },
    {
      id: "2",
      idAntigo: "0",
      desc: "salsichas",
    },
    {
      id: "1",
      idAntigo: "0",
      desc: "rojoes",
    },
  ];
  const array2 = [
    {
      id: "4",
      idAntigo: "2",
      desc: "arroz",
    },
    {
      id: "3",
      idAntigo: "0",
      desc: "massa",
    },
    {
      id: "2",
      idAntigo: "0",
      desc: "salsichas",
    },
    {
      id: "1",
      idAntigo: "0",
      desc: "rojoes",
    },
  ];

  for (var ar1 of array1) {
    console.log("ARRAY 1 --> " + ar1.id + "  " + ar1.idAntigo);
    for (var ar2 of array2) {
      console.log("ARRAY 2 --> " + ar2.id);
      if (ar1.id === ar2.idAntigo) {
        console.log("REMOVE --> " + ar2);
        console.log(array2.indexOf(ar2));
        array2.splice(array2.indexOf(ar2), 1);
      }
    }
  }

  return (
    <div style={{ margin: "auto" }}>
      {array2.map((a) => (
        <h1>{a.desc}</h1>
      ))}
    </div>
  );
};

export default Teste;
